import '../styles/about.css';
import images from '../assets/images/bg-iconbox.png'
function About() {
    return (
        <section className="about">
            <div className="max-width">
                <div className="container">
                    <div className="background">
                        
                    </div>
                </div>
            </div>
        </section>
    )
}

export default About;
